import { BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import "./App.css";
import Home from './pages/Home';
import DataPengguna from 'https://nusaberkahnet.000webhostapp.com/pages/DataPengguna';
import Product from 'https://nusaberkahnet.000webhostapp.com/pages/Product';
import DetailAlamat from 'https://nusaberkahnet.000webhostapp.com/pages/DetailAlamat';
import AboutUs from 'https://nusaberkahnet.000webhostapp.com/pages/AboutUs';
import TvProgram from 'https://nusaberkahnet.000webhostapp.com/pages/TvProgram';
import FaqPage from 'https://nusaberkahnet.000webhostapp.com/pages/FaqPage';
import ContactUs from 'https://nusaberkahnet.000webhostapp.com/pages/ContactUs';
import PaketAddOn from 'https://nusaberkahnet.000webhostapp.com/pages/PaketAddOn';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/product" element={<Product />} />
        <Route path="/datapengguna" element={<DataPengguna />} />
        <Route path="/detailalamat" element={<DetailAlamat />} />
        <Route path="/aboutus" element={<AboutUs />} />
        <Route path="/tvprogram" element={<TvProgram />} />
        <Route path="/faqpage" element={<FaqPage />} />
        <Route path="/contactus" element={<ContactUs />} />
        <Route path="/paketAddOn" element={<PaketAddOn />} />
      </Routes>
    </Router>
  )
};

export default App
